import React from 'react'
import { Form, Input, Button } from 'antd'

const dummy = {
    isLoggedIn: true
}

const Home = () => {
    return (
        <>
            <div>
                {dummy.isLoggedIn && <Form encType="multipart/form-data">
                    <Input.TextArea maxLength={140} placeholder="무슨일이 있었나요?" />
                    <div>
                        <input type="file" multiple hidden />
                        <Button>이미지 업로드</Button>
                        <Button type="primary" style={{ float: 'right' }}>짹짹</Button>
                    </div>
                </Form>}
            </div>
        </>
    )
}

export default Home
